import React from 'react';
import { Paper, TextField } from '@mui/material';

export default function Register() {
  return (
    <Paper
      sx={{
        width: '80vw',
        height: '80vh',
        padding: 3,
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <TextField label="Enter Name" fullWidth sx={{ marginBottom: 2 }} />
      <TextField label="Enter Email" fullWidth sx={{ marginBottom: 2 }} />
      <TextField label="Enter Password" type="password" fullWidth sx={{ marginBottom: 2 }} />
    </Paper>
  );
}
